import { Injectable } from '@angular/core';
import { Router } from '@angular/router';
import { Observable, Subject, from, switchMap } from 'rxjs';
import { HttpService } from 'src/app/services/http.service';
import { environment } from 'src/environments/environment.prod';
import { CustomerDataForm } from './models/customer.data-form';
import { CustomerDto } from './models/customer.dto';
import { ICustomer } from './models/interfaces/customer.interface';

@Injectable({
  providedIn: 'root',
})
export class CustomerService {
  #dataForm!: CustomerDataForm;

  readonly #apiPath = `${environment.baseUrl}/custormer`;
  readonly submit$ = new Subject<CustomerDto>();

  constructor(
    private readonly _httpServer: HttpService,
    private readonly _router: Router,
  ) {}

  get dataForm() {
    return this.#dataForm;
  }

  public getById(id: number | string): Observable<ICustomer> {
    return this._httpServer.getById(this.#apiPath, id);
  }

  public onCreateSubmit(): Observable<ICustomer> {
    return this.submit$.pipe(
      switchMap((dto) =>
        this._httpServer.create<ICustomer>(this.#apiPath, dto),
      ),
    );
  }

  public setDataForm(data: CustomerDataForm): void {
    this.#dataForm = data;
  }

  public onUpdateSubmit(id: number): Observable<ICustomer> {
    return this.submit$.pipe(
      switchMap((dto) =>
        this._httpServer.update<ICustomer>(this.#apiPath, id, dto),
      ),
    );
  }

  public navigatTo(...params: (string | number)[]): Observable<boolean> {
    const url = this._router.url.replace(/\/[^/]*$/, '');
    return from(this._router.navigate([url, ...params]));
  }
}

import { EventEmitter, Injectable } from '@angular/core';
import { AbstractControl, FormArray, FormGroup } from '@angular/forms';

@Injectable({
  providedIn: 'any',
})
export class FormService {
  public onSubmit(form: FormGroup | FormArray, cb: () => void) {
    if (form.valid) {
      cb();
    } else {
      this.checkFormValidations(form);
    }
  }

  private checkFormValidations(form: FormGroup | FormArray) {
    Object.keys(form.controls).forEach((field) => {
      const control = form.get(field) as AbstractControl;
      control.markAsDirty();
      control.markAsTouched();
      const status = control.status;
      (control.statusChanges as EventEmitter<string>).emit('CHECK_COMPONENT');
      (control.statusChanges as EventEmitter<string>).emit(status);
      if (control instanceof FormGroup || control instanceof FormArray) {
        this.checkFormValidations(control);
      }
    });
  }
}

import { HttpClient, HttpHeaders, HttpParams } from '@angular/common/http';
import { Injectable } from '@angular/core';
import { Observable, take } from 'rxjs';

@Injectable({
  providedIn: 'any',
})
export class HttpService {
  constructor(private readonly _http: HttpClient) {}

  private get options(): {
    headers?: HttpHeaders;
    params?: HttpParams;
  } {
    return {
      params: this.params,
    };
  }

  private get params(): HttpParams {
    return new HttpParams();
  }

  public getById<T>(apiPath: string, id: string | number): Observable<T> {
    return this._http.get<T>(`${apiPath}/${id}`).pipe(take(1));
  }

  public create<T, DTO = unknown>(
    apiPath: string,
    resource: DTO,
  ): Observable<T> {
    return this._http.post<T>(apiPath, resource, this.options).pipe(take(1));
  }

  public update<T, DTO = unknown>(
    apiPath: string,
    id: number,
    resource: DTO,
  ): Observable<T> {
    return this._http
      .patch<T>(`${apiPath}/${id}`, resource, this.options)
      .pipe(take(1));
  }

  public delete<T = unknown>(apiPath: string, id: number): Observable<T> {
    return this._http.delete<T>(`${apiPath}/${id}`, this.options).pipe(take(1));
  }

  public search<T>(apiPath: string): Observable<T> {
    return this._http.get<T>(`${apiPath}`).pipe(take(1));
  }
}

